Question.create(user_id: 179, category_id: 8, title: "6339: Then he replied: I am Friar Alberigo;", body: "Then he replied: I am Friar Alberigo;   May I go to the bottom of the ice.")
Question.create(user_id: 500, category_id: 7, title: "6342: ", body: "   He am I of the fruit of the bad garden,  Who here a date am getting for my fig.")
User.create(username: "Up705", email: "Up705", description: "great 705 stackinferno soul", password: "starwars")
Answer.create(user_id: 435, question_id: 242, body: "  Up in the world, no knowledge I possess.")
Answer.create(user_id: 698, question_id: 568, body: "  That oftentimes the soul descendeth here")
Answer.create(user_id: 323, question_id: 129, body: "And, that thou mayest more willingly remove")
User.create(username: "706", email: "706", description: "great 706 stackinferno soul", password: "starwars")
Question.create(user_id: 543, category_id: 4, title: "6354: ", body: "   From off my countenance these glassy tears,  Know that as soon as any soul betrays")
Question.create(user_id: 80, category_id: 6, title: "6357:   Until his time has wholly been revolved.", body: "  Until his time has wholly been revolved. As I have done, his body by a demon  Is taken from him, who thereafter rules it,")
Question.create(user_id: 84, category_id: 8, title: "6360:   And still perchance above appears the body", body: "  And still perchance above appears the body Itself down rushes into such a cistern;")
User.create(username: "thoushouldst707", email: "thoushouldst707", description: "great 707 stackinferno soul", password: "starwars")
Answer.create(user_id: 80, question_id: 53, body: "This thou shouldst know, if thou hast just come down;")
Answer.create(user_id: 591, question_id: 307, body: "")
Answer.create(user_id: 293, question_id: 101, body: "  And eats, and drinks, and sleeps, and puts on clothes.")
User.create(username: "There708", email: "There708", description: "great 708 stackinferno soul", password: "starwars")
Question.create(user_id: 621, category_id: 7, title: "6372:   There where is boiling the tenacious pitch,", body: "  There where is boiling the tenacious pitch, In moat above, said he, of Malebranche,")
Question.create(user_id: 564, category_id: 7, title: "6375: When this one left a devil in his stead", body: "When this one left a devil in his stead   As yet had Michel Zanche not arrived,")
Question.create(user_id: 11, category_id: 6, title: "6378: ", body: "   In his own body and one near of kin,  Who made together with him the betrayal.")
User.create(username: "And709", email: "And709", description: "great 709 stackinferno soul", password: "starwars")
Answer.create(user_id: 412, question_id: 221, body: "  And to be rude to him was courtesy.")
Answer.create(user_id: 110, question_id: 36, body: "  With every virtue, full of every vice")
Answer.create(user_id: 571, question_id: 565, body: "For with the vilest spirit of Romagna")
User.create(username: "710", email: "710", description: "great 710 stackinferno soul", password: "starwars")
Question.create(user_id: 613, category_id: 7, title: "6390: ", body: "   I found of you one such, who for his deeds  In soul already in Cocytus bathes,")
Question.create(user_id: 377, category_id: 5, title: "6393: ", body: " And still above in body seems alive!")
Question.create(user_id: 25, category_id: 2, title: "6396: ", body: " Inferno: Canto XXXIV")
User.create(username: "Towards711", email: "Towards711", description: "great 711 stackinferno soul", password: "starwars")
Answer.create(user_id: 695, question_id: 402, body: "  Towards us; therefore look in front of thee,")
Answer.create(user_id: 518, question_id: 497, body: "As, when there breathes a heavy fog, or when")
Answer.create(user_id: 354, question_id: 602, body: "")
User.create(username: "My712", email: "My712", description: "great 712 stackinferno soul", password: "starwars")
Question.create(user_id: 265, category_id: 8, title: "6408:   My Guide, because there was no other shelter.", body: "  My Guide, because there was no other shelter. Methought that such a building then I saw;  And, for the wind, I drew myself behind")
Question.create(user_id: 192, category_id: 3, title: "6411:   There where the shades were wholly covered up,", body: "  There where the shades were wholly covered up, Now was I, and with fear in verse I put it,")
Question.create(user_id: 368, category_id: 8, title: "6414: Some prone are lying, others stand erect,", body: "Some prone are lying, others stand erect,   And glimmered through like unto straws in glass.")
User.create(username: "713", email: "713", description: "great 713 stackinferno soul", password: "starwars")
Answer.create(user_id: 499, question_id: 275, body: "")
Answer.create(user_id: 522, question_id: 185, body: "  The creature who once had the beauteous semblance,")
Answer.create(user_id: 552, question_id: 632, body: "  Saying: Behold Dis, and behold the place")
User.create(username: "frozenI714", email: "frozenI714", description: "great 714 stackinferno soul", password: "starwars")
Question.create(user_id: 147, category_id: 5, title: "6426: How frozen I became and powerless then,", body: "How frozen I became and powerless then,   Where thou with fortitude must arm thyself.")
Question.create(user_id: 373, category_id: 5, title: "6429: ", body: "   Ask it not, Reader, for I write it not,  Because all language would be insufficient.")
Question.create(user_id: 664, category_id: 7, title: "6432:   What I became, being of both deprived.", body: "  What I became, being of both deprived. I did not die, and I alive remained not;  Think for thyself now, hast thou aught of wit,")
User.create(username: "From715", email: "From715", description: "great 715 stackinferno soul", password: "starwars")
Answer.create(user_id: 570, question_id: 585, body: "  From his mid-breast forth issued from the ice;")
Answer.create(user_id: 400, question_id: 645, body: "Than do the giants with those arms of his;")
Answer.create(user_id: 711, question_id: 546, body: "")
User.create(username: "Well716", email: "Well716", description: "great 716 stackinferno soul", password: "starwars")
Question.create(user_id: 59, category_id: 3, title: "6444:   Well may proceed from him all tribulation.", body: "  Well may proceed from him all tribulation. Were he as fair once, as he now is foul,  And lifted up his brow against his Maker,")
Question.create(user_id: 607, category_id: 7, title: "6447:   When I beheld three faces on his head!", body: "  When I beheld three faces on his head! O, what a marvel it appeared to me,")
Question.create(user_id: 251, category_id: 4, title: "6450: Two were the others, that were joined with this", body: "Two were the others, that were joined with this   The one in front, and that vermilion was;")
User.create(username: "717", email: "717", description: "great 717 stackinferno soul", password: "starwars")
Answer.create(user_id: 444, question_id: 651, body: "")
Answer.create(user_id: 712, question_id: 309, body: "  Who come from where the Nile falls valley-ward.")
Answer.create(user_id: 460, question_id: 473, body: "  Such as befitting were so great a bird;")
User.create(username: "Nofeathers718", email: "Nofeathers718", description: "great 718 stackinferno soul", password: "starwars")
Question.create(user_id: 219, category_id: 3, title: "6462:  No feathers had they, but as of a bat", body: " No feathers had they, but as of a bat   Sails of the sea I never saw so large.")
Question.create(user_id: 133, category_id: 5, title: "6465: ", body: "   Their fashion was; and he was waving them,  So that three winds proceeded forth therefrom.")
Question.create(user_id: 303, category_id: 3, title: "6468:   Trickled the tear-drops and the bloody drivel.", body: "  Trickled the tear-drops and the bloody drivel. Thereby Cocytus wholly was congealed.  With six eyes did he weep, and down three chins")
User.create(username: "A719", email: "A719", description: "great 719 stackinferno soul", password: "starwars")
Answer.create(user_id: 137, question_id: 666, body: "  A sinner, in the manner of a brake,")
Answer.create(user_id: 104, question_id: 334, body: "To him in front the biting was as naught")
Answer.create(user_id: 697, question_id: 561, body: "")
User.create(username: "With720", email: "With720", description: "great 720 stackinferno soul", password: "starwars")
Question.create(user_id: 462, category_id: 3, title: "6480:   With head inside, he plies his legs without.", body: "  With head inside, he plies his legs without. That soul up there which has the greatest pain,  The Master said, is Judas Iscariot;")
Question.create(user_id: 69, category_id: 3, title: "6483:   The one who hangs from the black jowl is Brutus;", body: "  The one who hangs from the black jowl is Brutus; Of the two others, who head downward are,")
Question.create(user_id: 672, category_id: 1, title: "6486: And the other, who so stalwart seems, is Cassius.", body: "And the other, who so stalwart seems, is Cassius.   See how he writhes himself, and speaks no word.")
User.create(username: "721", email: "721", description: "great 721 stackinferno soul", password: "starwars")
Answer.create(user_id: 193, question_id: 424, body: "")
Answer.create(user_id: 420, question_id: 412, body: "  And when the wings were opened wide apart,")
Answer.create(user_id: 589, question_id: 660, body: "  From fell to fell descended downward then")
User.create(username: "wewere722", email: "wewere722", description: "great 722 stackinferno soul", password: "starwars")
Question.create(user_id: 430, category_id: 8, title: "6498: When we were come to where the thigh revolves", body: "When we were come to where the thigh revolves   Between the thick hair and the frozen crust.")
Question.create(user_id: 360, category_id: 4, title: "6501: ", body: "   Exactly on the thickness of the haunch,  The Guide, with labour and with hard-drawn breath,")
Question.create(user_id: 481, category_id: 4, title: "6504:   So that to Hell I thought we were returning.", body: "  So that to Hell I thought we were returning. Turned round his head where he had had his legs,  And grappled to the hair, as one who mounts,")
User.create(username: "The723", email: "The723", description: "great 723 stackinferno soul", password: "starwars")
Answer.create(user_id: 48, question_id: 461, body: "  The Master said, panting as one fatigued,")
Answer.create(user_id: 311, question_id: 214, body: "Then through the opening of a rock he issued,")
Answer.create(user_id: 74, question_id: 87, body: "")
User.create(username: "And724", email: "And724", description: "great 724 stackinferno soul", password: "starwars")
Question.create(user_id: 145, category_id: 5, title: "6516:   And I beheld him upward hold his legs.", body: "  And I beheld him upward hold his legs. I lifted up mine eyes and thought to see  Lucifer in the same way I had left him;")
Question.create(user_id: 359, category_id: 6, title: "6519:   Let stolid people think who do not see", body: "  Let stolid people think who do not see And if I then became disquieted,")
Question.create(user_id: 20, category_id: 7, title: "6522: Rise up, the Master said, upon thy feet;", body: "Rise up, the Master said, upon thy feet;   What the point is beyond which I had passed.")
User.create(username: "725", email: "725", description: "great 725 stackinferno soul", password: "starwars")
Answer.create(user_id: 472, question_id: 101, body: "")
Answer.create(user_id: 333, question_id: 464, body: "  With floor uneven and unease of light.")
Answer.create(user_id: 201, question_id: 49, body: "  My Master, said I when I had arisen,")
User.create(username: "isthe726", email: "isthe726", description: "great 726 stackinferno soul", password: "starwars")
Question.create(user_id: 90, category_id: 3, title: "6534: Where is the ice? and how is this one fixed", body: "Where is the ice? and how is this one fixed   To draw me from an error speak a little;")
Question.create(user_id: 385, category_id: 8, title: "6537: ", body: "   Thus upside down? and how in such short time  From eve to morn has the sun made his transit?")
Question.create(user_id: 384, category_id: 8, title: "6540:   The hair of the fell worm, who mines the world.", body: "  The hair of the fell worm, who mines the world. And he to me: Thou still imaginest  Thou art beyond the centre, where I grasped")
User.create(username: "When727", email: "When727", description: "great 727 stackinferno soul", password: "starwars")
Answer.create(user_id: 543, question_id: 563, body: "  When round I turned me, thou didst pass the point")
Answer.create(user_id: 123, question_id: 692, body: "And now beneath the hemisphere art come")
Answer.create(user_id: 124, question_id: 472, body: "")
User.create(username: "Which728", email: "Which728", description: "great 728 stackinferno soul", password: "starwars")
Question.create(user_id: 25, category_id: 8, title: "6552:   Which makes the other face of the Judecca.", body: "  Which makes the other face of the Judecca. The Man who without sin was born and lived.  Thou hast thy feet upon the little sphere")
Question.create(user_id: 411, category_id: 1, title: "6555:   And he who with his hair a stairway made us", body: "  And he who with his hair a stairway made us Here it is morn when it is evening there;")
Question.create(user_id: 189, category_id: 1, title: "6558: Upon this side he fell down out of heaven;", body: "Upon this side he fell down out of heaven;   Still fixed remaineth as he was before.")
User.create(username: "729", email: "729", description: "great 729 stackinferno soul", password: "starwars")
Answer.create(user_id: 340, question_id: 629, body: "")
Answer.create(user_id: 172, question_id: 535, body: "  Left the place vacant here, and back recoiled.")
Answer.create(user_id: 394, question_id: 114, body: "  As far receding as the tomb extends,")
User.create(username: "asmall730", email: "asmall730", description: "great 730 stackinferno soul", password: "starwars")
Question.create(user_id: 402, category_id: 6, title: "6570: Of a small rivulet, that there descendeth", body: "Of a small rivulet, that there descendeth   Which not by sight is known, but by the sound")
Question.create(user_id: 632, category_id: 7, title: "6573: ", body: "   Through chasm within the stone, which it has gnawed  With course that winds about and slightly falls.")
Question.create(user_id: 80, category_id: 7, title: "6576:   And without care of having any rest", body: "  And without care of having any rest The Guide and I into that hidden road  Now entered, to return to the bright world;")
User.create(username: "Till731", email: "Till731", description: "great 731 stackinferno soul", password: "starwars")
Answer.create(user_id: 423, question_id: 248, body: "  Till I beheld through a round aperture")
Answer.create(user_id: 727, question_id: 180, body: "Thence we came forth to rebehold the stars.")
